import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'project_webdev_api_food';
}
<!-- app.component.html -->
<app-search-bar (search)="onSearch($event)"></app-search-bar>
